,p_plug_display_sequence=>20
,p_include_in_reg_disp_sel_yn=>'Y'
,p_plug_display_point=>'REGION_POSITION_01'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'<html lang="it-IT">',
'',
'<head>',
'    <title>ASS | Agenzia Spaziale STARBURSTER</title>',
'',
'    <!-- Bootstrap CSS -->',
'    <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/bootstrap@4.5.3/dist/css/bootstrap.min.css" ',
'          integrity="sha384-TX8t27EcRE3e/ihU7zmQxVncDAy5uIKz4rEkgIXeMed4M0jlfIDPvg6uqKI2xXr2" crossorigin="anonymous">',
'    <link rel="stylesheet" href="https://www.asi.it/wp-content/themes/asi-theme/css/fullpage.min.css"',
'          type="text/css"/>',
'    <!-- Custom -->',
'    <link rel="stylesheet" href="https://www.asi.it/wp-content/themes/asi-theme/style.css" type="text/css"',
'          media="all">',
'</head>',
'	',
'<body>',
'        ',
'<div id="wrapper" class="reply-wrapper text-center">',
'',
'    <div class="it-hero-wrapper it-dark it-overlay">',
'        <div class="img-responsive-wrapper">',
'            <div class="img-responsive">',
'                <div class="img-wrapper">',
'					                        <img src="https://www.asi.it/wp-content/uploads/2019/03/guJ7V.jpg"',
'                             title="ASI - L&#8217;Italia sulla Luna"',
'                             alt="ASI - L&#8217;Italia sulla Luna">',
'					                </div>',
'            </div>',
'        </div>',
'        <div class="breadcrumbContainer bg-white-alpha2">',
'            <div class="container">',
'                <nav aria-label="breadcrumb">',
'					<ul id="breadcrumbs" class="breadcrumbs"><li class="item-home"></li><li class="item-parent item-parent-581"></li><li class="item-current item-20406"><span title="STARBURSTER SULLA LUNA">STARBURSTER SULLA LUNA</strong></li></ul></nav>',
'            </div>',
'        </div>',
'    </div>',
'',
'    <div class="main my-5" role="main">',
'        <div class="container">',
'            <div class="row justify-content-center">',
'				',
'<!-- Page -->',
'<div class="col-md-8">',
'    <section>',
'        <p class="lead mb-5">',
unistr('			La corsa alla colonizzazione della Luna vede l\2019Italia e in particolar modo l''Agenzia Spaziale Sturburster ASS in pole position tra i protagonisti internazionali in questo decennio appena iniziato. La lunga e consolidata esperienza delle industrie ')
||unistr('nazionali e del mondo della ricerca spaziale, gestione e analisi avanzata dei dati raccolti, coordinate dalle istituzioni governative, ha consentito all\2019ASS di proporsi come partner affidabile, riconosciuto dalla comunit\00E0 mondiale.'),
'</p>',
'    </section>',
'    <div class="social-share">',
'		<div class="sfsi_widget sfsi_shortcode_container">',
'            </a><div id="sfsi_holder" class="sfsi_holders" style="position: relative; float: left;width:100%;z-index:-1;"></div ><script>window.addEventListener("sfsi_functions_loaded", function()',
'			{',
'				if (typeof sfsi_widget_set == "function") {',
'					sfsi_widget_set();',
'				}',
'			}); </script><div style="clear: both;"></div></div>    </div>',
'	<section class="text">',
'		<img width="300" height="201" class="attachment-medium size-medium wp-image-20414 wp-post-image" alt="Eclissi di Luna del 15 giugno 2011" decoding="async" fetchpriority="high" srcset="https://staticfanpage.akamaized.net/wp-content/uploads/sites/5/2'
||unistr('021/04/51046726427_33a33f01f7_k.jpg 500w" sizes="(max-width: 300px) 100vw, 300px" /><p>La conquista della Luna, questa volta per restarci, con sviluppo di un sistema informatico per consentire la gestione e l\2019analisi avanzata dei dati raccolti durant')
||unistr('e le missioni di esplorazione. Vede le collaborazioni del nostro paese con ASS e Nasa consolidate e inserite in un percorso avviato di presenza umana nello spazio, che forte degli oltre vent\2019anni di cooperazione in orbita bassa sulla Stazione spazial')
||'e internazionale, ora punta alla conquista del nostro satellite.</p>',
unistr('<p>La cornice entro la quale si sta concretizzando l\2019obiettivo di posizionare sensori avanzati in diverse regioni della superficie della Luna e di robot autonomi che supportano le operazioni sul campo. Il programma prevede che entro il 2024 l\2019allunag')
||unistr('gio dei primi sensori e il loro assemblaggio in orbita da parte di un team di specialisti.  Il sistema ha l\2019obiettivo di coordinare in tempo reale le attivit\00E0 dei membri della missione, gestire i dati provenienti dai sensori e consentire un monitorag')
||'gio completo e dettagliato delle operazioni in corso. </p>',
unistr('<p>L\2019impianto normativo si articola in collaborazioni bilaterali e multilaterali, con partner istituzionali, partner privati e specifiche collaborazioni con l\2019Agenzia Spaziale Sturburster e gli altri partner della Iss, per una nuova versione della co')
||'rsa alla conquista del nostro satellite naturale la Luna e poi del pianeta rosso. Una nuova corsa allo spazio, in cooperazione con altre nazioni e nel rispetto dei principi guida del Trattato delle Nazioni Unite sullo spazio extra-atmosferico (OST) d'
||'el 1967.</p>',
unistr('<p>In questo contesto l\2019Italia, oltre a operare all\2019interno dell\2019Esa tramite l\2019ASS, ha definito la sua partecipazione al programma in un bilaterale con la Nasa tenutosi il 25 settembre del 2020, per poi firmare i primi accordi italo-americani a ottob')
||'re dello scorso anno.</p>',
unistr('<p><em>Crediti immagine: Giovanni Gismondi, Andrea Gatto, Samuele Garofalo, Universit\00E0 degli Studi di Napoli Federico II</em></p>'),
'    </section>',
'</body>',
'</html>'))
,p_plug_query_options=>'DERIVED_REPORT_COLUMNS'
,p_attribute_01=>'Y'
,p_attribute_02=>'HTML'
);
