'        <p>Cosa rappresenta nella Pyramid:<br>',
unistr('            - Ogni livello del funnel rappresenta una priorit\00E0 (Critica, Alta, Media, Bassa).<br>'),
unistr('            - La dimensione di ogni livello indica il numero di interventi eseguiti per quella priorit\00E0.<br>'),
unistr('            - Un fannel tradizionale si aspetta che le priorit\00E0 pi\00F9 alte (come "Critica") abbiano meno interventi, mentre le priorit\00E0 pi\00F9 basse abbiano numeri maggiori, ma il grafico pu\00F2 anche mostrare l''inverso se c''\00E8 uno squilibrio.'),
'        </p>',
'        <p>',
'            SELECT ',
'    a.Priorita, ',
'    COUNT(i.Codice) AS Numero_Interventi<br>',
'FROM ',
'    ANOMALIE a',
'LEFT JOIN ',
'    INTERVENTI i ON a.Codice = i.Anomalia<br>',
'GROUP BY ',
'    a.Priorita<br>',
'ORDER BY ',
'    CASE ',
'        WHEN a.Priorita = ''Critica'' THEN 1',
'        WHEN a.Priorita = ''Alta'' THEN 2',
'        WHEN a.Priorita = ''Media'' THEN 3',
'        WHEN a.Priorita = ''Bassa'' THEN 4',
unistr('        ELSE 5 -- Per eventuali priorit\00E0 non previste'),
'    END;',
'',
'',
'        </p>',
'    </body>',
'</html>',
'',
'',
'',
''))
